import React from 'react'
import {Link} from 'react-router-dom'

const Color = ({hex, color, history}) => {
  console.log(hex, color, history)
  return (
    <div style={{backgroundColor: hex}}>
      <h2>{color}</h2>
      <Link to="/">Home</Link>
    </div>
  )
}
export default Color
